    "door_canvas_text": MessageLookupByLibrary.simpleMessage(
      "В начале работы следует убрать с дверного полотна всю фурнитуру, которая может помешать дальнейшей работе: замки, замочные скважины и дверной глазок. После этого необходимо снять полотно с петель и положить его на ровную удобную поверхность. Конечно, можно работать, когда дверь находится в вертикальном положении, но это менее удобно и под силу в основном профессионалам.\n\nДля утепления дверного полотна необходимо снять внутреннюю декоративную панель и затем заполнить короб полотна пенопластом или ватными плитами. Это позволит значительно снизить потери тепла через дверь.\n\nС внутренней стороны двери снимается накладка. У более дорогих моделей это может быть бронированный лист, у бюджетных — накладка из фанеры. В любом случае она крепится обычными саморезами. Старый утеплитель рекомендуется полностью удалить.\n\nЕсли внутри двери есть ребра жесткости, в них необходимо просверлить отверстия с шагом 40–45 см и заполнить их монтажной пеной. Диаметр отверстий должен соответствовать диаметру трубки баллона с пеной.\n\nПри использовании минеральной ваты необходимо создать гидробарьер из полиэтилена. Для пенополистирола такой барьер не обязателен. Утеплитель нарезается по размеру с небольшим запасом, чтобы избежать образования пустот.\n\nЗавершающий этап — укладка утеплителя в полости. Наиболее надежный способ крепления — жидкие гвозди или монтажная пена. После этого накладка устанавливается обратно, монтируется фурнитура, и дверь возвращается в проем.",
