    "door_intro_text": MessageLookupByLibrary.simpleMessage(
      "Главная цель дверей и окон — обеспечить защиту здания от холода, предотвращая его проникновение извне, и сохранять тепло внутри помещения. В отличие от окон, которые зачастую остаются закрытыми или являются глухими, входные двери мы часто открываем и закрываем. Из-за этого уплотнители на дверях становятся плоскими и теряют свою эффективность, не способны полностью выполнять свою функцию.\n\nВходные двери в дом и квартиру конструктивно могут быть абсолютно одинаковыми, но в частных домах двери выходят непосредственно на улицу, а в городских квартирах есть буфер в виде относительно теплого подъезда. Поэтому утепление двери в домах должно быть на порядок мощнее.\n\nВажно учитывать, что качество утеплителя внутри двери играет значительную роль в обеспечении теплоизоляции и комфортной температуры в помещении.\n\nВ случае перекошенного дверного полотна или деформации короба необходимо производить регулировку или даже замену петель.\nУ металлических дверных блоков перекос дверного полотна обычно происходит из-за изношенности навесов.\nХотя можно применить самоклеющийся молдинг по периметру полотна, этого недостаточно для полного устранения проблемы.",
