    "door_materials_text": MessageLookupByLibrary.simpleMessage(
      "Перед тем как приступить к утеплению, давайте рассмотрим, какой утеплитель мы будем использовать.\n\nТеоретически вместо пенопласта можно использовать экструдированный пенополистирол (Пеноплекс). Он гораздо плотнее и уровень теплоизоляции у него выше, однако цена примерно в 2 раза выше, а при такой толщине утепляющий эффект отличается незначительно.\n\nМинеральная вата широко применяется в качестве утеплителя для дверей. При выборе ватных плит рекомендуется использовать только плотные варианты, так как они не теряют объем при воздействии конденсата.\n\nСейчас на рынке можно найти недорогой комплект для утепления двери — самоклеящийся поролоновый молдинг. Обычно его хватает на один сезон.\n\nФольгированный изолон — эффективный материал для утепления дверей, создающий эффект термоса.\n\nСотовый картон практически неэффективен для утепления входных дверей.\n\nУтепление дверей можно разделить на 3 этапа:",
