    "door_seal_text": MessageLookupByLibrary.simpleMessage(
      "Для этих целей используется уплотнитель — полимерный или поролоновый (реже) на клеящейся основе. Предпочтение лучше отдать полимерному, так как срок его эксплуатации дольше, а эффективность выше. Поролоновая клейкая лента не продержится и сезон — в лучшем случае износится в течение года. Сам процесс утепления прост и предполагает наклейку уплотнителя по периметру дверного полотна. Главное — предварительно протереть и обезжирить поверхность, чтобы уплотнитель лучше приклеился.\n\nВажным аспектом, от которого зависит эффективность утепления, является правильный подбор толщины уплотнителя. Тонкий уплотнитель не будет выполнять свою функцию в полном объеме, а толстый создаст дополнительную нагрузку на дверные петли при закрывании двери и приведет к их ускоренному износу.\n\nВ решении этой проблемы поможет пластилин. Его нужно завернуть в целлофан и поместить между дверной коробкой и полотном. Затем дверь закрыть и открыть. Толщина полученного пластилинового валика будет соответствовать оптимальной толщине уплотнителя.",
