    "door_slopes_text": MessageLookupByLibrary.simpleMessage(
      "Теплоизоляцию откосов можно сделать под любую обшивку — технология одинаковая.\n\nПо способу производства работ различают три варианта отделки и утепления:\n1) Нанесение цементного раствора или шпаклевочной смеси непосредственно на стены;\n2) Приклеивание отделочных элементов с помощью клея или раствора;\n3) Каркасное крепление элементов отделки.\n\nМатериал для утепления подбирают в зависимости от вида полотна двери и покрытия стен внутри помещения. Чем больше отделочных слоев, тем лучше утепление дверного проема. В качестве верхнего слоя применяют: краску, обои, декоративную штукатурку, пластик, дерево, ламинат, МДФ, панели ПВХ.\n\nПеред отделочными работами дверь укрывают защитной пленкой. Монтажную пену, которая выступает за край дверной коробки, осторожно срезают канцелярским ножом.\n\nПосле подготовки поверхности её грунтуют. Через 3–4 часа процедуру повторяют.\n\nПосле того как поверхность высохла, начинают укладывать утеплитель. Если выбран пенопласт или экструдированный пенополистирол (пеноплекс), поверхность рекомендуется слегка поцарапать наждачным листом, чтобы уменьшить гладкость.\n\nПолистирол приклеивают, нанося шпателем порцию клея на каждую плиту, и дают хорошо просохнуть.\n\nДополнительно утеплитель крепят на пластиковые дюбеля при помощи перфоратора.\n\nГотовые участки проклеивают пластиковой сеткой — она защищает поверхность от появления мелких трещин. Для полного высыхания клея потребуется от 5 до 12 часов (в зависимости от температуры воздуха в помещении).\n\nПосле высыхания поверх сетки наносят слой шпаклевки. Если первым слоем выровнять поверхность не удалось, наносят следующий, учитывая время просыхания.\n\nПодсохшую шпаклевку обрабатывают крупнозернистыми наждачными листами и наносят слой грунтовки.\n\nДают конструкции просохнуть и шпаклюют уголок.\n\nПосле укладки пенопласта (или другого теплоизоляционного материала) выполняют финишное покрытие на свой вкус: обшивку гипсокартоном или декоративное оштукатуривание.",
