      "Окно очищают от загрязнений, обезжиривают и высушивают — поверхность должна быть идеально гладкой.\nПо периметру рамы закрепляют двусторонний скотч, затем разделяют слои пленки.\nПленку раскраивают по размеру стекла и приклеивают к скотчу, удаляя защитный слой.\nПосле равномерного распределения пленки по стеклу поверхность прогревают феном — материал дает усадку и выравнивается. Механически прижимать пленку не рекомендуется.",
