    ),
    "film_text_1": MessageLookupByLibrary.simpleMessage(
      "Теплозащитная пленка может быть наклеена на стекло окон, чтобы уменьшить теплопотери и повысить теплоизоляцию. Пластиковые окна хорошо защищают от холода, однако при сильных морозах без своевременного утепления возможны проблемы: теплый воздух уходит наружу, а холодный с влагой проникает внутрь, вызывая обледенение стекол. Один из доступных и эффективных способов — утепление окон пленкой, дающее хороший результат при минимальных затратах.\n\nЭнергосберегающая пленка позволяет сэкономить до 30% энергии, а некоторые виды — удерживать до 70% тепла, поскольку основные теплопотери происходят именно через стекло и щели.",
