    "film_text_2": MessageLookupByLibrary.simpleMessage(
      "Чтобы сделать помещение теплее, необходимо сначала заделать все щели с помощью монтажной пены и герметика, а также выполнить зимнюю регулировку окон. После этого можно приступать к утеплению окон энергосберегающей пленкой. Ее наклеивают с внутренней или внешней стороны стекла. Пленка плотно прилегает, не отслаивается при эксплуатации и при использовании прозрачных вариантов не затемняет помещение.",
    ),
    "film_text_3": MessageLookupByLibrary.simpleMessage(
      "Летом она снижает уровень ультрафиолета и делает помещение прохладнее.\nСуществуют разные виды пленок для утепления негерметичных окон и стеклопакетов — ПЭТ и ПВХ.\nПЭТ-листы представляют собой пластик на основе полиэтилентерефталата и по характеристикам не сравнимы со стеклопакетами.\nПЭТ для утепления негерметичных окон сначала крепится снаружи, затем изнутри помещения.\nПоэтому теплоизоляцию рекомендуется начинать в теплое время года, а не при сильных морозах.",
