    "solid_brick": MessageLookupByLibrary.simpleMessage("Solid"),
    "straw_title": MessageLookupByLibrary.simpleMessage("Утеплитель из соломы"),
    "text_about_proj": MessageLookupByLibrary.simpleMessage(
      "Информационно-обучающее мобильное приложение «Жылуу үй» разработано в рамках реализации инициативы «Повышение осведомленности населения Кыргызстана по вопросам энергоэффективности зданий в целях сокращения выбросов в атмосферу и митигации и адаптации к изменению климата» по программе малых грантов проекта «Таза Келечек».\n\nЦелью мобильного приложения является повышение уровня осведомленности населения страны по энергоэффективности зданий для сокращения использования твердого топлива.\n\nВ качестве первого шага к энергоэффективным зданиям, приложение в основном направлено на информирование людей о необходимости и важности теплоизоляции домов, а также на обучение людей основным методам теплоизоляции для экономии денег на отоплении. В качестве долгосрочной цели, приложение направлено на снижение уровня загрязнения воздуха в городах Кыргызской Республики и сокращения выбросов в атмосферу для адаптации и смягчения последствий изменения климата.\n\nИнформация в мобильном приложении изложена простым языком для того, чтобы была понятна всем. В качестве источников для содержательной части приложения были использованы собственные разработки, подсчеты привлеченных экспертов, а также материалы, опубликованные в рамках ранее реализованных проектов в области энергоэффективности зданий, в частности, были использованы Руководство для монтажников по теплоизоляции полов и потолков (проект «Укрепление потенциала кыргызской ассоциации – рациональное использование энергии в зданиях – фаза II», ЕБРР), Каталог технических решений по теплоизоляции наружных ограждающих конструкций индивидуальных жилых домов («КыргызНИИПСС», ОФ «Camp Alatoo», проект ГЭФ/ПРООН «Улучшение энергоэффективности в зданиях»), СНиП КР 23-01-2013 Строительная теплотехника (тепловая защита зданий), СП 23-101-2013 Проектирование тепловой защиты зданий, СНиП КР 23-02-00 Строительная климатология, ГОСТ 26602.2-99 Оконные и дверные блоки: методы определения воздухопроницаемости и проанализированные интернет-источники.\n\nМобильное приложение «Жылуу үй» профинансировано за счет гранта Государственного департамента США. Мнения и выводы, изложенные в приложении, принадлежат авторам и не обязательно отражают точку зрения Государственного департамента США.\n\nМобильное приложение «Жылуу үй» создано инициативной группой КНАУ имени К.И. Скрябина (Кенжебаева А.В., Анарбек Б.), а также командой привлеченных экспертов – Орозобековой А.Ч., Греб В.О., Миграновым Р.А., Элемановым О.И., Рысмендеевой Н.К.\n\nВыражаем благодарность всей сплоченной команде разработчиков и экспертов.",
    ),
    "text_planning": MessageLookupByLibrary.simpleMessage(
      "Оцените необходимое количество утеплителя и материалов. Исходите из размеров балкона и степени утепления, которую хотите достичь.\n",
    ),
    "text_planning_1_1": MessageLookupByLibrary.simpleMessage(
      "Тщательно осмотрите балкон/лоджию, обратив внимание на наличие повреждений, трещин, и следов влажности. Проверьте также состояние окон и дверей, чтобы убедиться, что они герметично закрываются и не пропускают холодный воздух.",
    ),
    "text_planning_1_2": MessageLookupByLibrary.simpleMessage(
      "Тщательно очистите помещение от грязи, пыли и лишних предметов, удалите со стен, пола и потолка старую краску, обои т.п. Чистые стены, потолок, пол обеспечат лучшую адгезию (способность покрытия к прочному сцеплению с поверхностью основания) новых материалов.",
    ),
    "text_planning_1_3": MessageLookupByLibrary.simpleMessage(
      "Заделайте все швы и трещины. Мелкие трещины и щелочки можно замазать атмосферостойким герметиком. Крупные щели можно заделать монтажной пеной. Это важно, чтобы предотвратить проникновение влаги и обеспечить прочное основание для утеплителя.",
    ),
    "text_planning_1_4": MessageLookupByLibrary.simpleMessage(
      "Если вы обнаружите проблемы с влажностью, такие как протекание крыши или стены, утечка из окон или другие источники влаги, они должны быть исправлены до начала утепления. Влага может нанести серьезный вред утеплителю и привести к образованию плесени.",
    ),
    "text_planning_2_1": MessageLookupByLibrary.simpleMessage(
      "После того, как вы подготовили поверхность, пришло время нанести грунтовку. Это шаг, который вы не должны пропускать.",
    ),
    "text_planning_2_2": MessageLookupByLibrary.simpleMessage(
      "Сначала тщательно перемешайте грунтовку, чтобы смесь стала однородной. После этого кистью или валиком равномерно нанести грунтовку на поверхность балкона. Когда вы закончите первый слой, дайте ему высохнуть.",
    ),
    "text_planning_2_3": MessageLookupByLibrary.simpleMessage(
      "Затем примерно через час нанесите второй слой. Наконец, дайте обоим слоям высохнуть не менее 3 часов. Грунтовка может стать сухой на ощупь через час, но это не означает, что она готова к нанесению следующего слоя. Не наносите грунтовку, пока она еще влажная. Если вы это сделаете, то не только покрытие не приклеится, но и испортит грунтовочный слой.",
    ),
    "text_planning_2_4": MessageLookupByLibrary.simpleMessage(
      "Выравнивание поверхностей (стен, потолка, пола)",
