    "wall": MessageLookupByLibrary.simpleMessage("Стена"),
    "wall_description_main": MessageLookupByLibrary.simpleMessage(
      "Стены являются одним из основных источников тепловых потерь. Примерно 35% от общих тепловых потерь. Это происходит из-за теплопроводности материалов стен и возможных дефектов, таких как трещины или неплотное уплотнение.\nПроисходит это из-за теплопроводности материалов, из которых состоят стены, и наличия возможных дефектов, которые могут способствовать утечке тепла.\n\nНекоторые строительные материалы имеют более высокую теплопроводность, что делает их менее эффективными в качестве теплоизоляции. Такие материалы, как кирпич, бетон или металл, могут быть менее теплоизолирующими, чем специальные материалы, разработанные для утепления, например, минеральная вата или пенополистироль.\nДефекты в стенах, такие как трещины, зазоры или неплотное уплотнение, также могут привести к утечке тепла через стены. Это может происходить из-за недостаточной уплотненности между стыками материалов или из-за повреждений стен, возникших в результате старения, погодных условий или строительных ошибок.\nЧтобы снизить тепловые потери через стены, необходимо обратить внимание на их теплоизоляцию. Установка качественных утеплителей, ремонт дефектов, устранение щелей и уплотнение стыков поможет значительно снизить потери тепла и повысить энергетическую эффективность здания. Также стоит учитывать, что качественная теплоизоляция стен поможет улучшить комфорт внутри помещений, предотвратить образование конденсата и сэкономить затраты на отопление и охлаждение.\nПодробная информация о методах утепления стен, вы можете изучить в разделе ",
    ),
