    ),
    "window_inner_layer_text": MessageLookupByLibrary.simpleMessage(
      "– пароизоляция. Расположен со стороны комнаты и препятствует попаданию влаги в монтажный шов. Это особенно важно для помещений с высокой влажностью (кухни, санузлы). Данный тип отделки может быть реализован герметизирующей фольгой.",
