    "window_title": MessageLookupByLibrary.simpleMessage("УТЕПЛЕНИЕ ОКОН"),
    "window_warning": MessageLookupByLibrary.simpleMessage(
      "Не позволяйте монтажной пене оставаться непокрытой более 1 месяца, так как она будет терять свои изоляционные свойства и прочность!",
    ),
    "windows_doors_description_part1": MessageLookupByLibrary.simpleMessage(
      "Другими критическими точками утечки тепла являются окна и двери во внешних стенах, особенно перемычки и прямые соединения окна со стеной здания.\nТепловые потери через окно происходят по нескольким каналам: потери через оконный блок и переплеты (мостики холода, неплотности), потери за счет теплопроводности воздуха и конвективных потоков между стеклами, а также теплопотери посредством теплового излучения. Очевидно, что, величина теплопотерь через оконный блок напрямую зависит от конструкции окна, используемых материалов, качества изготовления. В реальности она составляет около 10 % от общих теплопотерь из помещения. Остальные два канала теплопотерь - это потери непосредственно через остекление.\n\nОценить правильно ли были выполнены работы в этом случае довольно сложно.\nЕсли ошибки видны, мы можем минимизировать потери тепла на стыках, используя так называемую установку теплых окон с использованием лент и герметизирующей фольги.\nПодробнее об утеплении окон и дверей, вы можете изучить в разделе ",
